import React from "react";

import { useAuth0 } from "@auth0/auth0-react";
import Auth0ProviderWithHistoryA2J from "../../../auth0-provider-with-history-a2j";

const A2JLoginButton = () => {
  const { loginWithRedirect } = useAuth0();

  return (
    <Auth0ProviderWithHistoryA2J>
      <button
        onClick={() => loginWithRedirect()}
        id="qsLoginBtn"
        variant="primary"
        className="circular ui button"
        type="submit"
        style={{
          backgroundColor: "#00282A",
          color: "white",
          width: "20vw",
          marginTop: "4vh",
          marginLeft: "9vh",
        }}
      >
        A2J Login
      </button>
    </Auth0ProviderWithHistoryA2J>
  );
};

export default A2JLoginButton;
